import React from "react";

const Slider = () => {
  return (
    <div>
     <div className="row">
     <div className=" col-sm-12 col-lg-5"></div>
      <div className=" col-sm-12 col-lg-7 mt-3"></div>
     </div>
    </div>
  );
};

export default Slider;
